import React from "react";

function Game() {
	return (
		<div className="game">
			<div class="container">
				<p>
					<iframe
						src="https://c.simmer.io/static/unityFrame/index.html?url=https%3A%2F%2Fsimmercdn.com%2Funity%2FArOcg0jhIjQgaW2bkAbPZlOkgc83%2Fcontent%2F7cd8afbb-f845-02e4-913e-5f0428609d35&#038;imagePath=screens/4.png"
						styles="width:960px;height:600px;border:0"
					></iframe>
				</p>
			</div>
		</div>
	);
}

export default Game;
